import React, { Component } from 'react';
import './MenuBar.css';

class MenuBar extends Component {
	render() {
		return (
			<div className="MenuBar">
				<MenuBarItem text="skills"/>
				<MenuBarItem text="why ux?"/>
				<MenuBarItem text="projects"/>
				<MenuBarItem text="contact"/>
				<MenuBarItem text="login"/>
			</div>
		);
	}
}

class MenuBarItem extends Component {
	render() {
		return (
			<div className="MenuBarItem">
				{this.props.text}
			</div>
		);
	}
}

export { MenuBar, MenuBarItem };
